import React from "react";

type RepoCardProps = {
  repo: {
    repo: string;
    combined_score: number;
    maintenance_score: number;
    community_score: number;
    code_quality_score: number | null;
    documentation_score: number | null;
  };
};

const scoreColor = (score: number | null) => {
  if (score === null) return "#ccc";
  if (score >= 8) return "#4caf50";
  if (score >= 5) return "#ff9800";
  return "#f44336";
};

const RepoCard: React.FC<RepoCardProps> = ({ repo }) => {
  return (
    <div className="repo-card">
      <h3 className="repo-name">{repo.repo}</h3>
      <div className="score-row">
        <div className="score-label">Combined:</div>
        <div className="score-value" style={{ color: scoreColor(repo.combined_score) }}>
          {repo.combined_score}
        </div>
      </div>
      <div className="score-row">
        <div className="score-label">Maintenance:</div>
        <div className="score-value" style={{ color: scoreColor(repo.maintenance_score) }}>
          {repo.maintenance_score}
        </div>
      </div>
      <div className="score-row">
        <div className="score-label">Community:</div>
        <div className="score-value" style={{ color: scoreColor(repo.community_score) }}>
          {repo.community_score}
        </div>
      </div>
      <div className="score-row">
        <div className="score-label">Code Quality:</div>
        <div className="score-value" style={{ color: scoreColor(repo.code_quality_score) }}>
          {repo.code_quality_score ?? "N/A"}
        </div>
      </div>
      <div className="score-row">
        <div className="score-label">Documentation:</div>
        <div className="score-value" style={{ color: scoreColor(repo.documentation_score) }}>
          {repo.documentation_score ?? "N/A"}
        </div>
      </div>
    </div>
  );
};

export default RepoCard;
